};
// Initialize Firebase
firebase.initializeApp(fbconfig);

const HomePage = () => {
  let firestore = firebase.firestore();
  const docRef = firestore.collection("Products");
    return (<div>{docRef.get().then(doc => {
        if (doc) {
            document.getElementById("status").innerHTML = "Done";
            document.getElementById("root").innerHTML += `<div id="${
                doc.id
                }" onclick='load(${doc.id})'><span>${doc.id}</span> <span>${
                doc.data().Name
                }</span></div><div class="divider"></div>`;
        }
    })}</div>)
};
export default HomePage;
